import Nav from '../Nav bar/Nav';
import Footer from '../footer section/footer';
import img1  from "./images/Rectangle 746.png"

function Contact() {
  return (
    <div className="Contact">
        <Nav/>

        <div className="sec11">
            <img id="imgg1" src={img1} alt="" />
            <div className="bigcont">

                <div className="left">
                    .
                </div>
            </div>


        </div>

        <Footer/>
    </div>
  );
}

export default Contact;
